import React from "react";
import { Container, Navbar, Nav, NavDropdown, Button } from "react-bootstrap";

const NavbarHeader = () => {
  return (
    <>
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Container>
          {/* <Nav defaultActiveKey="/home" className="flex-column" id="side-menu">
            <Nav.Link href="/home">Dashboard</Nav.Link>
            <Nav.Link eventKey="">Expenses Filed</Nav.Link>
            <Nav.Link eventKey="">Analytics</Nav.Link>
          </Nav> */}
          {/* <Navbar.Brand href="/clients">Clients</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav"> */}
          {/* <Button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#side-menu" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation"> */}
          {/* <Button className="navbar-toggler" type="button">
            <span class="navbar-toggler-icon"></span>
          </Button> */}
          <Button variant="primary">Primary</Button>
          <Nav className="me-auto">
            <Nav.Link href="/clients">Clients</Nav.Link>
            <Nav.Link href="/projects">Projects</Nav.Link>
            <Nav.Link href="/employees">Employees</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="">Admin Options</Nav.Link>
            <NavDropdown title="User Name" id="collapsible-nav-dropdown">
              <NavDropdown.Item href="">Action1</NavDropdown.Item>
              <NavDropdown.Item href="">Action2</NavDropdown.Item>
              <NavDropdown.Item href="">Action3</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="">Action4</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          {/* </Navbar.Collapse> */}
        </Container>
      </Navbar>
    </>
  );
};

export default NavbarHeader;
